633.436 General order for abatement.

1. Except as provided in sections 633.211 and 633.212, shares of the distributees shall abate, for the payment of debts and charges, federal estate taxes, legacies, the shares ofchildren born or adopted after the making of a will, or the share of the surviving spouse whoelects to take against the will, without any preference or priority as between real and personalproperty, in the following order:

a.

Property not disposed of by the will;

b.

Property devised to the residuary devisee, except property devised to a surviving spouse who takes under the will;

c.

Property disposed of by the will, but not specifically devised and not devised to the residuary devisee, except property devised to a surviving spouse who takes under the will;

d.

Property specifically devised, except property devised to a surviving spouse who takes under the will;

e.

Property devised to a surviving spouse who takes under the will.2. A general devise charged on any specific property or fund shall, for purposes of abatement, be deemed property specifically devised to the extent of the value of the propertyon which it is charged. Upon the failure or insufficiency of the property on which it ischarged, it shall be deemed property not specifically devised to the extent of such failure orinsufficiency. [C51, §1284, 1285; R60, §2316, 2317; C73, §2334, 2335; C97, §3279; S13, §3279, 3279-a; C24, 27, 31, 35, 39, §

